import React from 'react';
import { Nav, NavLink } from 'react-router-dom';

const Header = () => {
  return(
    <div id="header">
      <Nav>
        <ul>
          <li><NavLink to="/dashboard"> Dashboard </NavLink></li>
          <li><NavLink to="/manage"> Manage </NavLink></li>
        </ul>
      </Nav>
    </div>
  )
}

export default Header;
